text:
Here's a wondering my son had when he looked at this;
why is this possible? Why aren't there any gaps between the rectangles drawn here?

That might end up being a nice exploration for students to figure out. #elemmathchat #MTBoS https://t.co/RXg1Qd4lyA

You can also use patterning for topics that students often find tricky, like completing the square for example.

@bobloch writes about just such an activity here: https://t.co/kg0V2v9U0y

Notice that the lesson attributed to me utilizes pattern recognition.
